			"name": alertName,
			"request": {
				"method": "POST",
				"header": [
					{
						"key": "Content-Type",
						"value": "application/json"
					}
				],
				"body": {
					"mode": "raw",
					"raw": $string(example, true)
				},
				"url": {
					"raw": "{{webhook-url}}",
					"host": [
						"{{webhook-url}}"
					]
				}
			},
			"response": []
		},
	"event": [
		{
			"listen": "prerequest",
